import React, { useState, useEffect } from "react";
import { useSelector } from "react-redux";
import Product from "../Product/Product";
import "./Home.css";
const Home = () => {
  const selector = useSelector((state) => state);
  console.log("####3");
  console.log(selector);
  const [products, setProducts] = useState([]);
  console.log(products);
  useEffect(() => {
    fetch("http://localhost:8090/products/api/v1/")
      .then((res) => res.json())
      .then((res) => {
        console.log(res);
        // setIsLoaded(true);
        setProducts(res);
      })
      .catch((err) => {
        console.log("ERROR: " + err);
      });
  }, []);
  return (
    <div className="home">
      <div className="featured">
        <div className="featured-title">
          <span className="bolder">Hi {selector.username}, </span>
          <span> treat yourself to a great deal today</span>
        </div>
      </div>
      <div className="product-list">
        {products.map((product, productId) => (
          <Product product={product} key={productId} />
        ))}
      </div>
    </div>
  );
};

export default Home;
